import React from 'react';

const Card = () => {
  return (
    <div style={{ 
      border: '1px solid #ccc', 
      borderRadius: '8px', 
      width: '300px', 
      padding: '16px', 
      textAlign: 'center',
      marginTop: '20px' // Add margin at the top
    }}>
      <img 
        src="https://source.unsplash.com/random/300x200" 
        alt="Random Unsplash" 
        style={{ width: '100%', borderRadius: '8px' }}
      />
      <h2>Card Title</h2>
      <p>This is a sample card description. It provides brief details about the card content.</p>
    </div>
  );
};

export default Card;
